import React, { useState, useEffect } from "react";
import { Link, useOutletContext } from "react-router-dom";

function Dashboard() {
    return (
        <div>
            <h1>My Dashboard</h1>
            <p>
                This is your dashboard.
            </p>
            <ul>
                <li><Link to="/profile">Profile</Link></li>
            </ul>
        </div>
    )
}

export default Dashboard;
